sys_variable_value.value:
(function execute(inputs, outputs) {
	if (inputs.status_code == "201") {
		outputs.status = "Success";
		var response = JSON.parse(inputs.response);
		outputs.account_id = response.accountid;
		outputs.parent_account_id = response._parentaccountid_value;
		outputs.primary_contact_id = response._primarycontactid_value;
	} else
		outputs = new MicrosoftDynamicsCRMErrorHandler()
		.createAnAccountErrorHandler(inputs, outputs);
})(inputs, outputs);

