sys_variable_value.value:
(function execute(inputs, outputs) {
	inputs = new MicrosoftDynamicsCRMUtils().trimStringInputs(inputs);
	var reqJson = {};
	reqJson["name"] = inputs.account_name ? inputs.account_name : undefined;
	if (inputs.primary_contact)
		reqJson["primarycontactid@odata.bind"] = "/contacts(" + inputs
		.primary_contact + ")";
	if (inputs.parent_account)
		reqJson["parentaccountid@odata.bind"] = "/accounts(" + inputs
		.parent_account + ")";
	reqJson["telephone1"] = inputs.telephone_number ? inputs
		.telephone_number : undefined;
	reqJson["websiteurl"] = inputs.website_url ? inputs.website_url :
		undefined;
	reqJson["address1_line1"] = inputs.address ? inputs.address : undefined;
	reqJson["address1_city"] = inputs.city ? inputs.city : undefined;
	reqJson["address1_stateorprovince"] = inputs.state ? inputs.state :
		undefined;
	reqJson["address1_country"] = inputs.country ? inputs.country :
		undefined;
	if (inputs.additional_fields) {
		try {
			var FieldsArr = inputs.additional_fields.trim().split(/\^/);
			for (var i = 0; i < FieldsArr.length; i++) {
				var nameValuePair = FieldsArr[i].split(/=(.+)/);
				var keyValueJson = new MicrosoftDynamicsCRMUtils().getValue(
					nameValuePair[0], nameValuePair[1]);
				reqJson[keyValueJson.key] = keyValueJson.value;
			}
		} catch (e) {}
	}
	outputs.reqbody = JSON.stringify(reqJson);

})(inputs, outputs);

